import React from 'react';
import Navbar from '../compenents/Navbar.js';
import Footer from '../compenents/Footer.js';
import styles from '../pages_css/Sneakers.css';

const Sneakers = () => {
  return (
    <div className="sd-sneakers">
      <Navbar />
      <div className="sneakers-container">
        <h2 className="sneakers-title">Sneakers</h2>
        <h3 className="sneakers-description">
          Every sneaker you want is always available and verified by StockW. Buy new sneakers from Air Jordan, adidas, Nike, Converse, and more coming soon!
        </h3>
      </div>

      
      
      <div className="sneakers-right">
        <div className="vectors-wrapper-3"></div>
        <div className="text-h">Recommended For You (?)</div>
        <div className="recommended-3">
          {contents1.slice(0, 3).map(content => (
            <Products
              key={content.id}
              image={content.image}
              name={content.name}
              price={content.price}
            />
          ))}
        </div>
        <div className="text-h">Trending Sneakers (?)</div>
        <div className="trending_sneakers-3">
          {contents1.slice(3, 6).map(content => (
            <Products
              key={content.id}
              image={content.image}
              name={content.name}
              price={content.price}
            />
          ))}
        </div>
        <div className="text-h">Popular Brands (?)</div>
        <div id="popular_brands-3" className="popular_brands-3">
          {brand_nav.map(product => (
            <Link to={`/sneakers/${product.id}`} key={product.id}>
              <img src={product.image} alt={product.productType} />
            </Link>
          ))}
        </div>
      </div> 

      
    </div>
  );
};

export default Sneakers;
